import React, { Component } from 'react'
import axios from 'axios'

export class Contrada extends Component {
    state = {
        contrada: {},
        isLoaded: false
    }
    componentDidMount() {
        axios.get(`/wordpress/wp-json/wp/v2/media/${this.props.match.params.id}`)
    }
    render() {
        return (
            <div>

            </div>
        )
    }
}

export default Contrada
